import React from "react";

function SettingImageWithAbsoultValue({
  imgUrl,
  top = "auto",
  bottom = "auto",
  right = "auto",
  left = "auto",
}) {
  return (
    <div
      className=""
      style={{
        top: { top },
        bottom: { bottom },
        right: { right },
        left: { left },
      }}
    >
      <img
        src={imgUrl}
        alt="#"
        style={{
          width: `100%`,
        }}
      />
    </div>
  );
}

export default SettingImageWithAbsoultValue;
